return ['x-generator'=>'GlotPress/4.0.0','translation-revision-date'=>'2023-06-02 08:17:43+0000','plural-forms'=>'nplurals=3; plural=(n % 10 == 1 && n % 100 != 11) ? 0 : ((n % 10 >= 2 && n % 10 <= 4 && (n % 100 < 12 || n % 100 > 14)) ? 1 : 2);','project-id-version'=>'Plugins - Product Filter by WBW - Development (trunk)','language'=>'ru','messages'=>['More plugins by WBW'=>'Больше плагинов от WBW','WBW'=>'WBW','Shortcode'=>'Шорткод','Documentation'=>'Документация','Currency Switcher'=>'Переключатель валют','Enter your email'=>'Введите ваш email адрес','FAQ'=>'FAQ','Go PRO'=>'Перейти на Pro','Invalid email format'=>'Неправильный формат электронной почты','MORE'=>'БОЛЬШЕ','More Info'=>'Подробнее','Need help?'=>'Нужна помощь?','New Features'=>'Новые возможности','Overview'=>'Обзор','Product Table'=>'Таблица товаров','Rate the plugin'=>'Оцените плагин','Upgrade To Pro'=>'Обновиться до Pro','Wordpress Forum'=>'Форум WordPress','Warning! Option uses php sessions! Filter products by different filter blocks of categories / tags / attributes by logic and / or.'=>'Предупреждение! Опция использует сеансы php! Фильтрует товары по разным блокам фильтров категорий/тегов/атрибутов по логике и/или.','This option recalculates all filters, taking into account third-party filters from other plugins on the page. For example, if the products on the page with the woobewoo filter were already pre-filtered by some third-party plugin filter, as a result of which the counters do not work correctly. But be careful, when the option is enabled, the filter may work slowly if the product base is large.'=>'Эта опция пересчитывает все фильтры с учетом сторонних фильтров из других плагинов на странице. Например, если товары на странице с фильтром woobewoo уже были предварительно отфильтрованы каким-то сторонним плагином-фильтром, в результате чего счетчики работают некорректно. Но будьте осторожны, при включенной опции фильтр может работать медленно, если товарная база большая.','Oldest first'=>'Сначала старые','SKU ascending'=>'Артикул по возрастанию','SKU descending'=>'Артикул по убыванию','On the category page, display only the child elements of the current category'=>'На странице категории отображать только дочерние элементы текущей категории','Display Only Children Of Current Category'=>'Отображать только дочерние элементы текущей категории','The filter will be located in a popup'=>'Фильтр будет расположен во всплывающем окне.','Floating mode'=>'Плавающий режим','Hides all parent categories of any level, leaving only the end children'=>'Скрывает все родительские категории любого уровня, оставляя только конечные дочерние','Hide parents of all levels'=>'Скрыть родителей всех уровней','If the option "Hide out of stock items from the catalog" is enabled, out of stock products will not be filtered. If this option is also enabled, on backorder products will also be excluded.'=>'Если включена опция «Скрыть товары, которых нет в наличии из каталога», то товары, которых нет в наличии, фильтроваться не будут. Если эта опция также включена, продукты, находящиеся в отложенном заказе, также будут исключены.','Exclude variations on backorder'=>'Исключить backorder вариации','The category page automatically hides the current category'=>'Страница категории автоматически скрывает текущую категорию','Hide current page category'=>'Скрыть категорию текущей страницы','Оn the category page automatically put a check mark for current category'=>'На странице категории автоматически ставится галочка для текущей категории','Check page category'=>'Отметить категорию страницы','No products found'=>'Товары не найдены','Clear-Filter'=>'Очистить-Фильтровать','Filter-Clear'=>'Фильтровать-Очистить','Both'=>'Оба','Auto Filtering'=>'Автоматическая Фильтрация','Filtering Button'=>'Фильтрция по Кнопке','For All Device'=>'Всех Устройствах','Only For Desktop'=>'Только на Настольных устройствах','Only For Mobile'=>'Только на Мобильных Устройстах','To prevent products container from collapsing during ajax.'=>'Чтобы контейнер с продуктами не разрушился во время ajax.','Do not remove products while loading'=>'Не удаляйте товары при загрузке','All pages'=>'Всех страницах','Specific pages'=>'Заданной странице','Show Fewer'=>'Показать Меньше','Show More'=>'Показать Больше','Allows third-party plugins that do not use WooCommerce shortcodes to filter products (required, for example, to work Product Grid Widget with categories preselection from Essential Addons for Elementor).'=>'Разрешает сторонним плагинам, которые не используют шорткоды WooCommerce для фильтрации продуктов (требуется, например, для работы виджета Product Grid Widget с предварительным выбором категорий из Essential Addons for Elementor).','Enable third-party prefilter'=>'Включить сторонний предварительный фильтр','When filtering, products will be displayed not only with the "publish" status, but also with the "private" status'=>'При фильтрации товары будут отображаться не только со статусом "Публичные", но и со статусом "Приватный"','Display Products With The Status "Private"'=>'Отображать товары со статусом «Приватный»','Only when a selection is made in the current filter show the next one'=>'Только когда сделан выбор в текущем фильтре, показывать следующий','Open Filters One By One'=>'Открывать фильтры один за другим','When this option is activated, this section of categories loses the ability to filter products and works as a navigation menu'=>'При активации этой опции этот раздел категорий лишается возможности фильтровать товары и работает как навигационное меню.','Import tables'=>'Импортировать таблицы','Use Web Content Accessibility Guidelines'=>'Использовать Web Content Accessibility Guidelines','Generate HTML based on WCAG standards'=>'Генерировать HTML на базе стандартов WCAG','Export selected'=>'Экспорт выбраные','Switch to menu mode'=>'Переключить в режим "Меню"','Checked Items In Bold'=>'Выделенные Пункты Сделать Жирными','run in background '=>'Запустить в Фоновом Режиме','Apply loader settings to all filters'=>'Применить настройки Загрузчика ка Всем Фильтрам','After filtration will be scroll to products block'=>'После фильтрации будет произведена прокрутка к блоку продуктов ','Autoscroll To Products After Filtering'=>'Автоматическая Прокрутка к Блоку Продуктов После Фильтрации','Redirect After Filter Selection'=>'Переадресация После Выбора Фильтра','Use exact values'=>'Используйте точные значения','The values will be changed by the specified percentage'=>'Значения будут изменены на указанный процент','Set tax rates'=>'Добавить налоговые ставки','Set the price min/max value. Doesn\'t working with recount prices option!'=>'Установите минимальное/максимальное значение цены. Не работает с опцией пересчета цен!','Set min/max prices'=>'Установить минимальные/максимальные цены','Select some stock status as default.'=>'Select some stock status as default.','Use as default'=>'Использовать по умолчанию','The maximum number of terms to be shown before Show more button'=>'Максимальное количество строк, отображаемых перед кнопкой Показать больше','Max terms show'=>'Максимальное количество строк для показа','Turn this on if you want to sort the values as numbers.'=>'Включите этот параметр, если хотите отсортировать значения как числа.','Show Alphabetical index. Works only for parent elements.'=>'Показать Алфавитный указатель. Работает только для родительских элементов.','Show element image. Not working with dropdown.'=>'Показать изображение элемента. Не работает с выпадающим списком.','Show images'=>'Показать изображения','Filter products by different categories using and/or logic.'=>'Фильтруйте товары по разным категориям, используя и/или логику.','Product selection'=>'Выбор продукта','If parent filter category was selected then extend selection to child categories.'=>'Если была выбрана родительская категория фильтра, распространить выбор на дочерние категории.','Extend parent select'=>'Расширить выбор родительского элемента','Transform attribute values to 