the index tables. If you have a lot of products, the process may take a while.'=>'Для корректной и быстрой работы фильтров плагин создает индексные таблицы из параметров товара. Эти таблицы автоматически перестраиваются при редактировании/создании товаров. Но если вы редактировали продукты сторонними плагинами или методами и/или заметили, что фильтр работает некорректно, то нажмите эту кнопку, чтобы принудительно перестроить индексные таблицы. Если у вас много продуктов, процесс может занять некоторое время.','Start indexing product parameters'=>'Начать индексацию параметров продукта','By default, the filter added by the shortcode is displayed everywhere. This option allows you to restrict the display to only those selected in "Display on pages"'=>'По умолчанию фильтр, добавленный шорткодом, отображается везде. Этот параметр позволяет ограничить отображение только теми страницами, которые выбраны в «Отображать на страницах».','Display On Pages Apply For Shortcode'=>'Отображать на страницах применить к шорткоду','When you select one filter element, the rest of the elements will be updated based on its'=>'Когда вы выбираете один фильтрующий элемент, остальные элементы будут обновляться в зависимости от него','Automatically Update The Filter'=>'Автоматически обновлять фильтр','Do not use shortcut settings on standard WooCommers pages'=>'Не использовать параметры шорткода на стандартных страницах WooCommerce.','Don\'t Use Shortcode Settings'=>'Не использовать параметры шорткода','If no products were found, display a message about it'=>'Если товары не найдены, вывести сообщение об этом','Display a message about not found products'=>'Отображать сообщение о не найденных товарах','No products were found matching your selection.'=>'Товаров, соответствующих вашему выбору, не найдено.','After filtration by attributes will be displayed product variation instead of main variable product'=>'После фильтрации по атрибутам будет отображаться вариация товара вместо основного вариативного товара','Display Variations Instead Of Variable Product'=>'Отображать Вариации вместо основного Вариативного продукта','After filtration will be display products with variations, what have filtered attributes'=>'После фильтрации будут отображаться товары с вариациями, у которых есть отфильтрованные атрибуты.','Filtering By Variations Attributes'=>'Фильтрация по атрибутам вариаций','Apply Parameters From The Address Bar To Display Filter Items'=>'Применить параметры из адресной строки для отображения элементов фильтра','Turn on only when necessary. Please note that "slug" should only contain lowercase Latin letters, numbers and hyphens.'=>'Включайте только при необходимости. Обратите внимание, что «слаг» должен содержать только строчные латинские буквы, цифры и дефисы.','Show Category Slugs In URL Instead Of IDs '=>'Показывать слаги категорий в URL вместо ID','Allow only one item from the list to be selected at a time'=>'Разрешить выбор только одного элемента из списка за раз','Single select mode'=>'Режим одиночного выбора','Display brand description before product list'=>'Отображать описание бренда перед списком товаров','Display brand description'=>'Отображать описание бренда','Multiblock Taxonomy Logic'=>'Логика многоблочной таксономии','ATTENTION!!! This option can greatly slow down page loading if you have a lot of products.'=>'ВНИМАНИЕ!!! Эта опция может сильно замедлить загрузку страницы, если у вас много товаров.','Turn on if you want the sidebar to appear above content on mobile devices. Some themes do not have blocks required for this option.'=>'Включите, если хотите, чтобы боковая панель отображалась над блоком продуктов на мобильных устройствах. В некоторых темах нет блоков, необходимых для этой опции.','Padding child list'=>'Отступ дочернего списка','Custom title'=>'Произвольный заголовок','The filter will be displayed on all child categories'=>'Фильтр будет отображаться на всех дочерних категориях','Include Child Categories'=>'Включить дочерние категории','Name Z to A'=>'Имя от Я до A','Name A to Z'=>'Имя от А до Я','If after ajax filtering there are differences in the styles of the list of products, pagination or count-block, then enable this option. Important: for correct operation, we recommend filling the Product container selector option.'=>'Если после ajax-фильтрации есть отличия в стилях списка товаров, пагинации или кол-блока, то включите эту опцию. Важно: для корректной работы рекомендуем заполнить опцию выбора контейнера продукта.','Force Theme Templates'=>'Форсировать Шаблоны темы','Custom selector for loading a loader and updating the product list. The default product selector is `ul.products`. If the Filter after ajax filtering does not find the product block and cannot replace it with the filtered list of products, the page will reload. In this case, you need to specify the product block selector in this setting.'=>'Пользовательский селектор для загрузки загрузчика и обновления списка товаров. Селектор продукта по умолчанию — ul.products. Если Фильтр после ajax-фильтрации не находит блок товаров и не может заменить его отфильтрованным списком товаров, страница перезагрузится. В этом случае вам нужно указать в этой настройке селектор товарного блока.','By default if a value is selected in the filter, items without products will still be displayed (this was done on purpose so that you can quickly switch between items).If the option is enabled, empty elements will be hidden regardless of the filter activity (this also applies to loading via ajax and when reloading the page with the parameters specified in the url).'=>'По умолчанию, если в фильтре выбрано значение, все равно будут отображаться пункты без товаров (это сделано специально, чтобы можно было быстро переключаться между товарами). Если опция включена, пустые элементы будут скрыты вне зависимости от активности фильтра (это касается и загрузки через ajax и при перезагрузке страницы с параметрами, указанными в url).','Same behavior for active filter'=>'То же поведение для активного фильтра','You can select one of the available pages to redirect to it after selecting a filter'=>'Вы можете выбрать одну из доступных страниц для перенаправления на нее после выбора фильтра','Sort as numbers'=>'Сортировать по числам','You can choose to display the sorting by dropdown or radio buttons'=>'Вы можете выбрать отображение сортировки по раскрывающемуся списку или переключателям','If there are several product shortcodes on the page, you can add a container selector that will limit the effect of this filter only inside it.'=>'Если на странице несколько шорткодов товара, можно добавить селектор контейнера, который будет ограничивать действие этого фильтра только внутри одного из них.','Product Container Selector'=>'Селектор контейнера продуктов','Product List / Loader Selector'=>'Блок товаров / Селектор загрузчика','Attributes are displayed according to the order of their selection in the input fields.'=>'Атрибуты отображаются в порядке их выбора в полях ввода.','Depending on whether you need one or several categories to be available at the same time, show your categories list as checkbox or dropdown.'=>'В зависимости от того, хотите ли вы, чтобы одна или несколько категорий были доступны одновременно, покажите список категорий в виде флажка или раскрывающегося списка.','Select the sorting options available for site users (min two options).'=>'Выберите параметры сортировки, доступные для пользователей сайта (минимум два варианта).','Exclude brand terms from filter by ids. Example input: 1,2,3.'=>'Исключить названия брендов из фильтра по идентификаторам. Пример ввода: 1,2,3.','Set brands sorting by ascendance or descendance.'=>'Установите сортировку брендов по восхождению или убыванию.','Change stock status names.'=>'Измените названия статусов запасов.','Show title label with open/close filter functionality. Be carefull when show it as close with "Hide filter by title click" filter oprionality. In such case users do not see filter content.'=>'Показать метку заголовка с функцией открытия/закрытия фильтра. Будьте осторожны, когда показываете его как можно ближе с опцией фильтра «Скрыть фильтр по щелчку заголовка». В этом случае пользователи не видят содержимое фильтра.','Set the filter width in pixels or percent.'=>'Задайте ширину фильтра в пикселях или процентах.','Exclude category terms from filter by ids. Example input: 1,2,3.'=>'Исключить термины категорий из фильтра по идентификаторам. Пример ввода: 1,2,3.','Hide categories without products.'=>'Скрыть категории без товаров.','Set categories sorting by ascendance or descendance.'=>'Установить сортировку категорий по восхождению или по убыванию.','Define which role show users in the drop down.'=>'Определите, какая роль показывает пользователей в раскрывающемся списке.','Select the animated loader, which appears when filtering results are loading <a href="https://woobewoo.com/documentation/loader-options/" target="_blank">Learn More</a>.'=>'Выберите анимацию загрузчика, который будет отбражен в процессе загрузки результатов фильтрации<a href="https://woobewoo.com/documentation/loader-options/" target="_blank">Learn More</a>.','Filtering of categories list on filter process.'=>'Фильтрация списка категорий в процессе фильтрации.','Filtering Of Categories List'=>'Фильтрация списка категорий','Be careful when deactivate it with filter titles shown as close, In such case users do not see filter content.'=>'Будьте осторожны при деактивации с тайтлов фильтров, отображаемыми как закрытые. В этом случае пользователи не увидят содержимое фильтра.','When you click on the block open icon, all other open blocks will be automatically closed'=>'При нажатии на значок открытия блока все остальные открытые блоки будут автоматически закрыты.','If One Filter Block Is Open, Other Blocks Are Closed'=>'Если один блок фильтра открыт, другие блоки закрыты','Input "no products found" text for category.'=>'Введите текст «продукты не найдены» для категории.','Always Filtering By All Products'=>'Всегда фильтровать по всем продуктам из базы продуктов','Search for a filtering results among all shop products on any shop pages.'=>'Фильтрация по всей базе товаров магазина на любых страницах магазина (игнорируются даже ограничения страниц категорий).','Change the order of filter buttons on the page.'=>'Измените порядок кнопок фильтра на странице.','Select the position of filter buttons on the page.'=>'Выберите положение кнопок фильтра на странице.','Reset All Filters On Page'=>'Сбросить все фильтры на странице','Remove other woofilters on page except current filter.'=>'Удалить другие фильтры на странице, кроме текущего фильтра.','Force Show Only Current Filter On Page'=>'Принудительно показывать только текущий фильтр на странице','Set attributes sorting by ascendance or descendance.'=>'Установить сортировку атрибутов по восхождению или по убыванию.','Select attribute to be displayed on site from the list.'=>'Выберите атрибут для отображения на сайте из списка.','Select the price filter skin.'=>'Выберите скин ценового фильтра.','Exclude tags terms from filter by ids. Example input: 1,2,3.'=>'Исключить теги из фильтра по идентификаторам. Пример ввода: 1,2,3.','Hide tags without products.'=>'Скрыть теги без товаров.','Set tags sorting by ascendance or descendance.'=>'Установить сортировку тегов по восхождению или по убыванию.','Show search field in multiple dropdown box.'=>'Показать поле поиска в раскрывающихся списках с множественным выбором.','vendors'=>'Продавцы','text'=>'текст','Learn More'=>'Learn More','When the filter is clear, he will be restrict filtered results only by selected items. Be careful when using with other filters in block!.'=>'Когда фильтр очищен, он будет ограничивать отфильтрованные результаты только выбранными элементами. Будьте осторожны при использовании с другими фильтрами в блоке!','Restrict filtering results only to selected categories'=>'Ограничить результаты фильтрации только выбранными категориями','If parent filter category was selected then extend filter result to child categories.'=>'Если была выбрана родительская категория фильтра, распространить выбор на дочерние категории.','Filter with children'=>'Фильтровать с дочерними','Only in parent'=>'Только в родительском','Only in child'=>'Только в дочернем','Could be in both, child or parent'=>'Может быть как в дочернем, так и в родительском','Restrict filtering result only to child categories or only to parent if both of them selected in the same time.'=>'Ограничьте результат фильтрации только дочерними категориями или только родительскими, если они оба выбраны одновременно.','Product selection hierarchically'=>'Иерархический выбор продукта','If enabled, then show only parent elements, if there are children, they are minimized.'=>'Если включено, то показывать только родительские элементы, если есть дочерние, то они свернуты.','Collapsible'=>'Свертываемый','Show search field in multiple dropdown box'=>'Показать поле поиска в раскрывающихся списках с множественным выбором.','Show search for dropdown'=>'Показать поиск для раскрывающегося списка','Include children'=>'Включая дочерние','Set Mobile/Desktop Breakpoint'=>'Установить точку перехода в мобильный/десктоп режим','Vendors'=>'Продавцы','Create Filter'=>'Создать фильтр','Filter Name'=>'Имя фильтра','Select Filter'=>'Выбрать фильтр','Select Woofilter'=>'Выбрать Woofilter','Woofilters'=>'Woofilters','Count for parent category also her children count. <strong>Warning!</strong> If filtering will slow do uncheck this option.'=>'Учитывать родительскую категорию, а также ее дочерние элементы. <strong>Внимание!</strong> Если фильтрация будет работать медленно, снимите этот флажок.','Count parents with children'=>'Посчитать родителей с детьми','Selected tags will be marked as default and hidden on frontend.'=>'Выбранные теги будут помечены как используемые по умолчанию и скрыты во внешнем интерфейсе.','And'=>'И','Or'=>'Или','Enable this option when ajax filtering does not work as expected. For example, sorting does not work. Removes filters such as posts_orderby and pre_get_posts.'=>'Включите эту опцию, если фильтрация ajax не работает должным образом. Например, сортировка не работает. Удаляет такие фильтры, как posts_orderby и pre_get_posts.','Remove Actions Before Filtering'=>'Удалить действия перед фильтрацией','Set breakpoint for all options that depend on a mobile/desktop view. "Show title label", "Display filter on" etc.'=>'Установите точку останова для всех параметров, которые зависят от мобильного / рабочего стола. «Показать метку заголовка», «Отображать фильтр» и т. д.','Select Filter Buttons Order'=>'Выберите порядок кнопок фильтра','Depending on whether you need one or several attributes to be available at the same time, show attributes list as checkbox or dropdown. <strong>Attention!</strong> Slider type work only with numeric titles of attributes.'=>'В зависимости от того, хотите ли вы, чтобы один или несколько атрибутов были доступны одновременно, отобразите список атрибутов в виде чекбокса или раскрывающегося списка. <strong>Внимание!</strong> Тип Slider работает только с числовыми названиями атрибутов.','Filter header'=>'Заголовок фильтра','Choose tags for filter titles. Any settings you leave blank will default.'=>'Выберите теги для заголовков фильтров. Любые настройки, которые вы оставите пустыми, будут использоваться по умолчанию.','3-rd level title'=>'Заголовок 3-го уровня','2-nd level title'=>'Заголовок 2-го уровня','1-st level title'=>'Заголовок 1-го уровня','Use Custom tags'=>'Задать HTML теги','Filter Activation Type'=>'Тип активации фильтра','Set number of products per row. This number will only be shown after filter is applied!'=>'Установить количество товаров в ряду. Этот номер будет отображаться только после применения фильтра!','Set Number Of Products Per Row'=>'Количество товаров в строке','This sets the number of decimal points shown in displayed prices.'=>'Задает число знаков после запятой в отображаемых ценах.','Use custom number of decimals'=>'Использовать пользовательское количество десятичных знаков','Automatically change min/max price by selected filters (If product category loading slowly - Disable this function).'=>'Автоматически изменять минимальную/максимальную цену по выбранным фильтрам (если категория товаров загружается медленно - отключите эту функцию).','Recount Min/Max Price By Selected Filter'=>'Пересчитать минимальную/максимальную цену по выбранному фильтру','Display On Pages'=>'Отображать на страницах','Do not leave empty fields. Enter `i` if you want the value to be calculated automatically (for From field this will be the minimum price, for field To - the maximum price'=>'Не оставляйте пустых полей. Введите `i`, если вы хотите, чтобы значение рассчитывалось автоматически (для поля From это будет минимальная цена, для поля To - максимальная цена','Use Under/Over label instead of minimum and maximum values.'=>'Используйте метку Under/Over вместо минимального и максимального значений.','Use Under/Over values'=>'Используйте значения Under/Over','If checked, the entire list of brands will always be visible, otherwise only available for filtered items.'=>'Если этот флажок установлен, весь список брендов всегда будет виден, в противном случае он будет доступен только для отфильтрованных товаров.','Clear filter only to selected brands'=>'Очистить фильтр только для выбранных брендов','Make selected brands as default'=>'Сделать выбранные бренды по умолчанию','Select product brands to be displayed on your site from the list. If you want to select several brands, hold the "Shift" button and click on brand names. Or you can hold "Ctrl" and click on brand names. Press "Ctrl" + "a" for checking all brands.'=>'Выберите из списка бренды продуктов, которые будут отображаться на вашем сайте. Если вы хотите выбрать несколько брендов, удерживайте кнопку «Shift» и кликайте по названиям брендов. Или вы можете удерживать «Ctrl» и нажимать на названия брендов. Нажмите «Ctrl» + «a», чтобы проверить все бренды.','Always display all brands'=>'Всегда отображать все бренды','Show search display the bar for searching by brand name in the filter.'=>'Отображать строку поиска по названию бренда в фильтре.','When the filter is clear, he will be filtered only by selected items. Be careful when using two or more brand filters!'=>'Когда фильтр очищен, он будет фильтроваться только по выбранным элементам. Будьте осторожны при использовании двух и более фильтров брендов!','Selected brands will be marked as default and hidden on frontend.'=>'Выбранные бренды будут помечены как используемые по умолчанию и скрыты на странице.','Hide brands without products'=>'Скрыть бренды без товаров','Show only brands children.'=>'Показывать только дочерние бренды.','Hide brands parent'=>'Скрыть родительские бренды','Depending on whether you need one or several brands to be available at the same time, show your brands list as checkbox or dropdown.'=>'В зависимости от того, хотите ли вы, чтобы один или несколько брендов были доступны одновременно, отобразите список брендов в виде чекбоксов или раскрывающегося списка.','Over'=>'Над','Under'=>'Под','Perfect brands'=>'Perfect brands','Custom'=>'Произвольно','Security check'=>'Проверка безопасности','is available'=>'доступно','Оnly one of'=>'Только один из','Horizontal'=>'Горизонтально','Vertical'=>'Вертикально','Select a vertical or horizontal layout and set the count of columns.'=>'Выберите вертикальный или горизонтальный макет и установите количество столбцов.','There were some problems while trying to retrieve our news, but you can always check all list %s.'=>'При попытке получить наши новости возникли некоторые проблемы, но вы всегда можете проверить весь список %s.','Contact us'=>'Свяжитесь с нами','Layout'=>'Макет','and other'=>'и другие','By default all subscribers add to the WordPress. 
					To find your subscribers go to Users tab on the left navigation menu of WordPress admin area. 
					Also available subscription to the Aweber, MailChimp, MailPoet %1$s. 
					If you want to add another subscription service - just %2$s and provide URL of the subscription service.'=>'По умолчанию все подписчики добавляются в WordPress.

					Чтобы найти своих подписчиков, перейдите на вкладку «Пользователи» в левом навигационном меню административной панели WordPress.
					Также доступна подписка на Aweber, MailChimp, MailPoet %1$s.
					Если вы хотите добавить другую службу подписки - просто %2$s и укажите URL службы подписки.','You can help us improve our plugin - by'=>'Вы можете помочь нам улучшить наш плагин -','contact us'=>'Связаться с нами','If you have a question, %s and will do our best to help you'=>'Если у вас есть вопрос, %s, мы сделаем все возможное, чтобы помочь вам','Check example'=>'Пример','Show when user tries to exit from your site.'=>'Показывать, когда пользователь пытается уйти с вашего сайта.','Check out %s! Years of experience in WordPress plugins developers made those list unbreakable!'=>'Проверьте %s! Многолетний опыт разработчиков плагинов для WordPress сделал этот список непоколебимым!','We will collect only our plugin usage statistic data - to understand Your needs and make our solution better for You.'=>'Мы будем собирать только статистические данные об использовании наших плагинов, чтобы понять ваши потребности и сделать наше решение лучше для вас.','enabling Usage Statistics'=>'включение статистики использования','On behalf of the entire %s company I would like to thank you for been with us, and I really hope that our software helped you.'=>'От имени всей компании %s я хотел бы поблагодарить вас за то, что вы были с нами, и я очень надеюсь, что наше программное обеспечение помогло вам.','Could you please do me a BIG favor and give it a 5-star rating on WordPress? Just to help us spread the word and boost our motivation.'=>'Вы сделаете мне БОЛЬШОЕ одолжение, если поставите 5 звезд в рейтинге WordPress - это здорово мотивирует!','Hey, I noticed you just use %s over a week – that’s awesome!'=>'Эй, я заметил, что ты используешь %s более недели — это круто!','Step'=>'Шаг','Already in the list'=>'Уже в списке','Roles'=>'Роли','your Filter'=>'ваш фильтр','Create'=>'Создать','You have no Filters for now.'=>'У вас пока нет фильтров.','Select filters to add'=>'Добавить секцию фильтра','Show paternal and subsidiary categories (for checkbox list). If you display only some categories, make sure that the parent categories are selected.'=>'Показать родительские и дочерние категории (для списка чекбоксов). Если вы отображаете только некоторые категории, убедитесь, что выбраны родительские категории.','Use Custom Styles'=>'Использовать пользовательские стили','General styles'=>'Основные стили','Buttons'=>'Кнопки','Main'=>'Основные','Hide attributes without products.'=>'Скрыть атрибуты без товаров.','Hello Woobewoo Team!'=>'Привет команда WooBeWoo!','Titles'=>'Заголовки','Blocks'=>'Блоки','loader Icon'=>'Иконка загрузчика','Filter Loader'=>'Загрузчик Фильтра','Use Filter Titles As Slugs For The Filter Clear Buttons'=>'Используйте заголовки фильтров в качестве слагов для кнопок очистки фильтра','Selected parameters will be displayed in the top/bottom of the filter .'=>'Выбранные параметры будут отображаться в верхней/нижней части фильтра.','Columns'=>'Столбцы','Filter Content'=>'Контент фильтра','Filter Buttons'=>'Кнопка фильтра','Loader'=>'Загрузчик','loader Word'=>'Текст загрузчика','Content'=>'Содержимое','Choose custom styles for filter buttons. Any settings you leave blank will default.'=>'Выберите кастомные стили для кнопки фильтра. Любые настройки, которые вы оставите пустыми, будут использоваться по умолчанию.','Buttons Styling'=>'Стилизация кнопок','Choose custom styles for filter titles. Any settings you leave blank will default.'=>'Выберите пользовательские стили для заголовков фильтров. Любые настройки, которые вы оставите пустыми, будут использоваться по умолчанию.','Titles Styling'=>'Оформление заголовков','Choose custom styles for filter blocks. Any settings you leave blank will default.'=>'Выберите пользовательские стили для блоков фильтров. Любые настройки, которые вы оставите пустыми, будут использоваться по умолчанию.','Blocks Styling'=>'Оформление блоков','Disable the use of custom plugin styles for filter elements. This option does not work in admin preview.'=>'Отключите использование пользовательских стилей плагинов для элементов фильтра. Этот параметр не работает в режиме предварительного просмотра с правами администратора.','Automatically disabled parameters without products. Works only when options Show count and Always display all... are enabled.'=>'Автоматически отключенные параметры без товаров. Работает только при включенных параметрах Показать количество и Всегда отображать все....','Show Parameters Without Products As Disabled'=>'Показать параметры без продуктов как отключенные','If "Filtering button" option was selected, the "Filter" button appears at the page. It allows users to set all necessary filter parameters before starting the filtering. If "Auto filtering" option was selected, filtering starts as soon as filter elements change and the data reloads automatically.'=>'Если была выбрана опция «Кнопка фильтрации», на странице появляется кнопка «Фильтрация». Это позволяет пользователям установить все необходимые параметры фильтра перед началом фильтрации. Если была выбрана опция «Автофильтрация», фильтрация начинается, как только меняются элементы фильтра, и данные перезагружаются автоматически.','This option enables Ajax search. Product filtering and displaying results in a browser will be run in the background without full page reload.'=>'Эта опция включает поиск Ajax. Фильтрация товаров и отображение результатов в браузере будут выполняться в фоновом режиме без полной перезагрузки страницы.','Hide filter on shop and categories pages that displays only categories or subcategories without products.'=>'Скрыть фильтр на страницах магазина и категорий, который отображает только категории или подкатегории без товаров.','Hide Filter On Shop Pages Without Products'=>'Скрыть фильтр на страницах магазина без товаров','mobile'=>'Для мобильных','desktop'=>'Для настольных','Use theme styles'=>'Использовать стили темы','Display Hide Filters Button'=>'Показать кнопку «Скрыть фильтры»','Display Selected Parameters Of Filters'=>'Показать выбранные параметры фильтров','For long vertic